<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<title>Loading CSS</title>

	<style type="text/css">
		* {
			box-sizing: border-box;
		}

		.loader {
			max-width: 100vw;
			min-height: 100vh;
			display: flex;
			justify-content: center;
			place-items: center;
			z-index: 100;
		}

		.dots {
			border-radius: 50%;
			border: 7px solid black;
			margin: 0 0.5rem;
                        background: black;
		}

		.dots:nth-child(1) {
			animation: loader 0.6s ease-in-out alternate infinite;
		}

		.dots:nth-child(2) {
			animation: loader 0.6s ease-in-out alternate 0.2s infinite;
		}

		.dots:nth-child(3) {
			animation: loader 0.6s ease-in-out alternate 0.4s infinite;
		}

		@keyframes loader {
			100% {
				transform: scale(2);
			}
		}

		/* Gallery */
		.gallery img {
			display: block;
			width: 100%;
			margin: 0 auto;
		}
	</style>
</head>
<body>
	<div class="loader">
		<div class="dots"></div>
		<div class="dots"></div>
		<div class="dots"></div>
	</div>
